import React from "react";
import Image from "next/image";
import Slider from "react-slick";
import { Wrap, Flex, FlexItems } from "../styles/Companies";

class Companies extends React.Component {
  render() {
    const settings = {
      infinite: true,
      slidesToShow: 5,
      slidesToScroll: 1,
      autoplay: true,
      autoplaySpeed: 1000,
      responsive: [
        {
          breakpoint: 768,
          settings: {
            slidesToShow: 3,
            slidesToScroll: 1,
          },
        },
      ],
    };
    return (
      <div className="container">
        <Wrap>
          <Slider {...settings}>

              <FlexItems>
              <div className="slick-div">
                <Flex>
                  <Image src="/001.svg" width={180} height={120} />
                </Flex>
                </div>
                <Flex>
                  <Image src="/002.svg" width={150} height={80} />
                </Flex>
                <Flex>
                  <Image src="/003.svg" width={180} height={120} />
                </Flex>
                <Flex>
                  <Image src="/004.svg" width={180} height={120} />
                </Flex>
                <Flex>
                  <Image src="/005.svg" width={140} height={80} />
                </Flex>
                <Flex>
                  <Image src="/001.svg" width={180} height={120} />
                </Flex>
                <Flex>
                  <Image src="/006.svg" width={180} height={120} />
                </Flex>
              </FlexItems>

          </Slider>
        </Wrap>
      </div>
    );
  }
}

export default Companies;
